#if defined(GL_FRAGMENT_PRECISION_HIGH)

precision highp float;

#else

precision mediump float;

#endif

struct PixelInput
{
	float4 position : POSITION;
	float2 texture_coordinate : TEXCOORD0;
	float4 color : COLOR0;
};
float4 smoothing;
sampler _tex_diffuse : register(s0);
struct PixelOutput
{
	float4 color : COLOR0;
};
PixelOutput main(PixelInput input)
{
	PixelOutput output;
	float4 diffuse_sample = tex2D(_tex_diffuse, input.texture_coordinate);
	diffuse_sample.a = smoothstep(0.5f - smoothing.x, 0.5f + smoothing.x, diffuse_sample.a);
	output.color = input.color * diffuse_sample;
	return output;
}

struct VertexInput
{
	float4 position : POSITION;
	float4 color : COLOR;
	float2 texture_coordinate : TEXCOORD0;
};
float4x4 world_view_proj;
struct VertexOutput
{
	float4 position : POSITION;
	float2 texture_coordinate : TEXCOORD0;
	float4 color : COLOR0;
};
VertexOutput main(VertexInput input)
{
	VertexOutput output;
	output.position = mul(input.position, world_view_proj);
	output.texture_coordinate = input.texture_coordinate;
	output.color = input.color;
	return output;
}

in vec4 _vary_position;
in vec2 _vary_texture_coordinate;
in vec4 _vary_color;
uniform vec4 smoothing;
uniform sampler2D _tex_diffuse;
out vec4 _out_color;
void main()
{
	vec4 diffuse_sample = texture(_tex_diffuse, _vary_texture_coordinate);
	diffuse_sample.a = smoothstep(0.5f - smoothing.x, 0.5f + smoothing.x, diffuse_sample.a);
	_out_color = _vary_color * diffuse_sample;
}

